import React, { Component } from 'react';
import './App.css';

class App extends Component {
  state = { users: [] }

  componentDidMount() { 
   fetch('/testings')
   .then(res => res.json())
   .then(users => this.setState({ users }))
   .catch((err) => console.log('Error Caught')) 
  }


  render() {
   return (
    <div>{this.state.users}</div>
    )
  }
}

export default App;
